import React, { Component } from "react";
import CardComponentFunctionComponent from "../../../components/home/card/card-function-component/CardComponentFunctionComponent";
import CardClassComponent from "../../../components/home/card/card-class-component/CardClassComponent";
import "./Card.css"

export default class Card extends Component {
  render() {
    return (
      <div className="container-fuild card-top">
        <div className="row">
          <CardComponentFunctionComponent image="https://kenh14cdn.com/2020/4/18/anh-chup-man-hinh-2020-04-18-luc-111307-sa-15871832757401368371058.png" link="https://kenh14.vn/gai-xinh-bap-can-bo-thanh-tam-lai-dinh-lien-hoan-phot-lam-tuesday-va-an-choi-tha-cua-o-bar-nguoi-trong-cuoc-noi-gi-20200412151113705.chn" />
          <CardClassComponent image="https://kenh14cdn.com/2020/4/12/img5963-15866787651691146592224.jpg" link="https://kenh14.vn/gai-xinh-bap-can-bo-thanh-tam-lai-dinh-lien-hoan-phot-lam-tuesday-va-an-choi-tha-cua-o-bar-nguoi-trong-cuoc-noi-gi-20200412151113705.chn" />
          <CardClassComponent image="https://kenh14cdn.com/2020/4/12/img5963-15866787651691146592224.jpg" link="https://kenh14.vn/gai-xinh-bap-can-bo-thanh-tam-lai-dinh-lien-hoan-phot-lam-tuesday-va-an-choi-tha-cua-o-bar-nguoi-trong-cuoc-noi-gi-20200412151113705.chn" />
        </div>
      </div>
    );
  }
}
